LEO PRIME carefully said nothing as he waited for everyone to leave
the room. He glanced over and saw QUICKSTRIDE coming in to check in on
UPROAR. With a deft movement LEO pushed a button closing off the side
of the medbay he was on from the side that QUICKSTRIDE and UPROAR were
on, and then darkned the lgass for privacy. If QUICKSTRIDE wanted to
leave there was a secondary door for that.

Finally LEO turned to TUSCON as he folded his arms behind his back.
TUSCON was larger than LEO, and yet there was no fear in LEO&#39;s optics
as he carefully examined him, noting the changes that have occured
because of his new beast mode.

&quot;Undermine you?&quot; LEO PRIME said finally, his voice neutral and yet a
curious lilt to it. &quot;You allowed your subordinates, your family as you
say, to intentionally try to harm another Maximal or Autobot.&quot; He
paused as he shifted his gaze to the map of the jungle scene for a
moment. &quot;Under normal circumstances that would be automatic
disciplinary action. An assault on a fellow soldier and you allowed
it?&quot;

While LEO PRIME&#39;s voice was low, there was a controlled power in it,
an anger of his own held in powerful check. &quot;The council has not sent
a single mech to ancient Earth in years, and now all of a sudden you
get nine?&quot; He tilted his head as he watched for changes in expression,
&quot;Have you any idea why that might be?&quot;

